import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../styles/RegisterUser.css';

const RegisterUser = () => {
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: '',
    center: '',
    permissions: []
  });
  const [centers, setCenters] = useState([]);
  const [message, setMessage] = useState('');

  // List of available tables (permissions) to assign
  const availablePermissions = [
    'Donor Master',
    'Maharaj Master',
    'Inventory Master',
    'Category Master',
    'Donation Center Master',
    'Donation Mode Master',
    'Unit Master'
  ];

  // Fetch centers from backend
  useEffect(() => {
    axios.get('/api/centers')
      .then(response => setCenters(response.data))
      .catch(err => console.error('Error fetching centers:', err));
  }, []);

  // Handle input changes
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  // Handle checkbox changes for permissions
  const handleCheckboxChange = (e) => {
    const { name, checked } = e.target;
    setFormData(prev => {
      let updatedPermissions = prev.permissions;
      if (checked) {
        updatedPermissions = [...prev.permissions, name];
      } else {
        updatedPermissions = prev.permissions.filter(permission => permission !== name);
      }
      return { ...prev, permissions: updatedPermissions };
    });
  };

  // Updated submit handler to match the backend endpoint
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      // Note the updated URL to match the effective endpoint /api/register-user/register
      const response = await axios.post('/api/register-user/register', formData);
      setMessage(response.data.message || 'User registered successfully!');
      // Optionally reset the form
      setFormData({
        username: '',
        email: '',
        password: '',
        center: '',
        permissions: []
      });
    } catch (error) {
      console.error(error);
      setMessage(error.response?.data?.message || 'Failed to register user');
    }
  };

  return (
    <div className="register-user-container">
      <h2>Register New User</h2>
      <form onSubmit={handleSubmit}>
        <div className="input-group">
          <input 
            type="text"
            name="username"
            placeholder="Username"
            value={formData.username}
            onChange={handleChange}
            required 
          />
        </div>
        <div className="input-group">
          <input 
            type="email"
            name="email"
            placeholder="Email"
            value={formData.email}
            onChange={handleChange}
            required 
          />
        </div>
        <div className="input-group">
          <input 
            type="password"
            name="password"
            placeholder="Password"
            value={formData.password}
            onChange={handleChange}
            required 
          />
        </div>
        <div className="input-group">
          <label>Select Vayavach Center:</label>
          <select 
            name="center" 
            value={formData.center} 
            onChange={handleChange} 
            required
          >
            <option value="">--Select Center--</option>
            {centers.map(center => (
              <option key={center.code} value={center.code}>
                {center.name}
              </option>
            ))}
          </select>
        </div>
        <div className="permissions-group">
          <label>Assign Access (Select Tables):</label>
          <div className="checkboxes">
            {availablePermissions.map((permission, idx) => (
              <div key={idx} className="checkbox-item">
                <input 
                  type="checkbox"
                  name={permission}
                  checked={formData.permissions.includes(permission)}
                  onChange={handleCheckboxChange}
                />
                <span>{permission}</span>
              </div>
            ))}
          </div>
        </div>
        <button type="submit">Register</button>
      </form>
      {message && <p className="form-message">{message}</p>}
    </div>
  );
};

export default RegisterUser;
